import TextField from '@mui/material/TextField';
import { styled } from '@mui/material/styles';
import theme from "../../components/UI/Theme";
import Button from '@mui/material/Button';

import classes from './Login.module.css';

const InputTextField = styled(TextField)({
  '& label.Mui-focused': {
    color: theme.palette.common.lightBlue,
  },
  "&:hover label": {
    color: theme.palette.common.lightBlue
  },
  '& .MuiOutlinedInput-root': {
    '& fieldset': {
      borderColor: 'white',
    },
    '&:hover fieldset': {
      borderColor: theme.palette.common.lightBlue,
    },
    '&.Mui-focused fieldset': {
      borderColor: theme.palette.common.lightBlue,
    },
  }
});

const ContainedButton = styled(Button)({
  ...theme.typography.buttonCustomization,
  color: "white",
  boxShadow: "none",
  width: "100%",
  marginTop: "5%",
  [theme.breakpoints.down("md")]: {
    width: "100%",
    marginRight: "0px",
    marginBottom: "16px"
  }
})

const Login = () => {
return (
  <div className={classes["main-container"]}>
    <form className={classes.form}>
      <div class="container">
        <h1 style={{marginBottom: "28px"}}>Log in to Fintechport</h1>
        <InputTextField sx={{marginBottom: "12px"}} required fullWidth id="name" label="Enter Username" variant="filled" size="small" />
        <InputTextField required fullWidth id="password" label="Enter Password" variant="filled" size="small"/>
        <ContainedButton variant="contained" color="secondary">Log In</ContainedButton>
      </div>
      <div class="container">
        <p style={{marginBottom: "0px", paddingBottom: "4px"}}>Or Sign Up using</p>
        <p className={classes.link}><a href="#">Sign Up</a></p>
        <p>Forgot <a className={classes.link} href="#">Password?</a></p>
      </div>
    </form>
  </div>
)
};

export default Login;
